// Define the order and user IDs
Id excludedOrderId = '8019Z00000b23RLQAY';
Id userId = '0056M00000ASrV4QAL';

// Query orders to delete
List<Order> ordersToDelete = [
        SELECT Id
        FROM Order
        WHERE Id != :excludedOrderId
        AND CreatedById = :userId
];

// Check if there are orders to delete
if (!ordersToDelete.isEmpty()) {
    delete ordersToDelete;
}

// Define the quote and user IDs
Id excludedQuoteId = '0Q09Z00000411RBSAY';

// Query quotes to delete
List<Quote> quotesToDelete = [
        SELECT Id
        FROM Quote
        WHERE Id != :excludedQuoteId
        AND CreatedById = :userId
];

// Check if there are quotes to delete
if (!quotesToDelete.isEmpty()) {
    delete quotesToDelete;
}
